		<script>
			var t_left_right;
			
			function drag_map_right()
				{
					var scroll_value = document.getElementById("map_display").scrollLeft;
					scroll_value = scroll_value + 10;
					document.getElementById("map_display").scrollLeft = scroll_value;
					t_left_right = setTimeout("drag_map_right()", 10);
				} 
			
			function drag_map_left()
				{
					var scroll_value = document.getElementById("map_display").scrollLeft;
					scroll_value = scroll_value - 10;
					document.getElementById("map_display").scrollLeft = scroll_value;
					t_left_right = setTimeout("drag_map_left()", 10);
				}

			function show_coords(event)
				{
				  var x = event.clientX;
				  document.getElementById("coords").value = x;
				  document.getElementById("map_display").scrollLeft = x - 460;
				}
		</script>
